import { withStyles } from "@material-ui/core/styles";
import Drawer from "@material-ui/core/Drawer";
import AppBar from "@material-ui/core/AppBar";
import Toolbar from "@material-ui/core/Toolbar";
import List from "@material-ui/core/List";
import CssBaseline from "@material-ui/core/CssBaseline";
import Typography from "@material-ui/core/Typography";
import Divider from "@material-ui/core/Divider";
import IconButton from "@material-ui/core/IconButton";
import MenuIcon from "@material-ui/icons/Menu";
import ChevronLeftIcon from "@material-ui/icons/ChevronLeft";
import ChevronRightIcon from "@material-ui/icons/ChevronRight";
import ListItem from "@material-ui/core/ListItem";
import ListItemIcon from "@material-ui/core/ListItemIcon";
import ListItemText from "@material-ui/core/ListItemText";
import InboxIcon from "@material-ui/icons/MoveToInbox";
import MailIcon from "@material-ui/icons/Mail";

class Home extends Component {
  constructor(props) {
    super(props);
    this.state = {
      isLoggedIn: false
    };
  }

  componentWillMount() {
    if (sessionStorage.getItem("user")) {
    } else {
      this.setState({ isLoggedIn: true });
    }
  }

  render() {
    if (this.state.isLoggedIn) {
      return <Redirect to="/admin/login" />;
    }

    return (
      <div>
        <Header />
        <div className="content">
          <Panel header="Dashboard">
            Lorem, ipsum dolor sit amet consectetur adipisicing elit. Error
            provident quisquam reiciendis quidem modi, iste praesentium?
            Voluptatibus porro, neque dolore reprehenderit tempora culpa sit
            molestias dolores distinctio, ratione placeat illo!
          </Panel>
          <Card title="Simple Card" style={{ width: "360px" }}>
            <div>
              Lorem ipsum dolor sit amet, consectetur adipisicing elit.
              Inventore sed consequuntur error repudiandae numquam deserunt
              quisquam repellat libero asperiores earum nam nobis, culpa ratione
              quam perferendis esse, cupiditate neque quas!
            </div>
          </Card>
        </div>
      </div>
    );
  }
}

export default Home;
